import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { useCookies } from "react-cookie";

// Material-UI Components
import { AppBar, Box, Toolbar, Typography, Button, IconButton, Menu, MenuItem, useTheme, useMediaQuery } from "@mui/material";
// Material-UI Icon
import MenuIcon from '@mui/icons-material/Menu';

export const Navbar = () => {
  const [cookies, setCookies] = useCookies(["access_token"]);
  const navigate = useNavigate();

  // Hooks to check screen size and manage mobile menu state
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down("sm")); // True if screen is small (mobile)
  const [anchorEl, setAnchorEl] = useState(null); // State for mobile menu anchor

  // Opens the mobile menu
  const handleMenu = (event) => {
    setAnchorEl(event.currentTarget);
  };

  // Closes the mobile menu
  const handleClose = () => {
    setAnchorEl(null);
  };

  // Handles logout action and closes mobile menu if open
  const logout = () => {
    handleClose(); // Close menu first
    setCookies("access_token", "");
    window.localStorage.clear();
    navigate("/auth");
  };

  // Reusable component for desktop navigation links
  const NavLink = ({ to, label, onClick }) => (
    <Button
      color="inherit"
      component={onClick ? Button : Link} // Use Button if onClick is provided, else Link
      to={to}
      onClick={onClick}
      sx={{ marginX: 1 }} // Add some horizontal spacing between buttons
    >
      {label}
    </Button>
  );

  // Reusable component for mobile menu items
  const MobileMenuItem = ({ to, label, onClick }) => (
    <MenuItem
      component={onClick ? MenuItem : Link} // Use MenuItem if onClick is provided, else Link
      to={to}
      onClick={onClick}
    >
      {label}
    </MenuItem>
  );

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" elevation={3} sx={{ backgroundColor: "#212121" }}>
        <Toolbar>
          {/* App Title/Logo */}
          <Typography
            variant="h6"
            component={Link}
            to="/"
            sx={{ flexGrow: 1, textDecoration: "none", color: "inherit" }}
          >
            Memories
          </Typography>

          {/* Conditional Rendering based on screen size */}
          {isMobile ? (
            // --- Mobile View ---
            <>
              {/* Hamburger Icon Button */}
              <IconButton
                size="large"
                edge="end" // Place icon at the end
                color="inherit"
                aria-label="menu"
                onClick={handleMenu}
              >
                <MenuIcon />
              </IconButton>
              {/* Mobile Menu Dropdown */}
              <Menu
                id="menu-appbar"
                anchorEl={anchorEl}
                anchorOrigin={{ vertical: 'top', horizontal: 'right' }}
                keepMounted
                transformOrigin={{ vertical: 'top', horizontal: 'right' }}
                open={Boolean(anchorEl)}
                onClose={handleClose}
              >
                {/* Menu items */}
                <MobileMenuItem to="/" label="Home" onClick={handleClose} />
                <MobileMenuItem to="/create-memory" label="Create Memory" onClick={handleClose} />
                {!cookies.access_token ? (
                  <MobileMenuItem to="/auth" label="Login/Register" onClick={handleClose} />
                ) : (
                  [ // Use array for multiple items inside conditional rendering
                    <MobileMenuItem key="saved" to="/saved-memories" label="Saved Memories" onClick={handleClose} />,
                    <MobileMenuItem key="logout" label="Logout" onClick={logout} />
                  ]
                )}
              </Menu>
            </>
          ) : (
            // --- Desktop View ---
            <Box>
              {/* Horizontal Navigation Links */}
              <NavLink to="/" label="Home" />
              <NavLink to="/create-memory" label="Create Memory" />
              {!cookies.access_token ? (
                <NavLink to="/auth" label="Login/Register" />
              ) : (
                <>
                  <NavLink to="/saved-memories" label="Saved Memories" />
                  <NavLink label="Logout" onClick={logout} />
                </>
              )}
            </Box>
          )}
        </Toolbar>
      </AppBar>
    </Box>
  );
};
